import React from "react";

export default function Search() {
  return (
    <div>
      <h1>Search</h1>
      <form className="form">
        <label className="label" htmlFor="query"></label>
        <input
          type="text"
          name="query"
          placeholder="Search for a movie"
        ></input>
        <button class="button" type="submit">
          Search
        </button>
      </form>
    </div>
  );
}
